def _get_builtin_metadata():
    #id_to_name = {x['id']: x['name'] for x in PACO_CATEGORIES}
    thing_dataset_id_to_contiguous_id = {v['id']:idx   for (idx,v) in enumerate(PACO_CATEGORIES)}
    thing_classes = [x['name'] for x in PACO_CATEGORIES]
    return {
        "thing_dataset_id_to_contiguous_id": thing_dataset_id_to_contiguous_id,
        "thing_classes": thing_classes
    }



SOURCE_DATASET = [
    ('lvis',"coco",('train','val','test')),
    ('ego4d',"ego4d/v1/paco_frames",('train','val','test_dev'))
]
def register_all_paco_dataset(root):
    for source_dataset,source_path,source_split in SOURCE_DATASET:
        for split in source_split:
            key = f'paco_{source_dataset}_{split}'
            json_file = f'paco/paco_{source_dataset}_v1_{split}.json'
            register_coco_instances(
                    key,
                    _get_builtin_metadata(),
                    os.path.join(root, json_file) if "://" not in json_file else json_file,
                    os.path.join(root, source_path),
                    dataset_name_in_dict="paco",
                    segm_only=True
            )

